import React ,{useState,useEffect}from 'react'
import { AnimatePresence,motion } from 'framer-motion';
import { useSnapshot } from 'valtio';
import Config from '../config/config';
import state from '../store';
import {download} from '../assets'
import { EditorTabs , FilterTabs,DecalTypes} from '../config/constants';
import {downloadCanvasToImage,reader} from '../config/helpers'
import { fadeAnimation,slideAnimation } from '../config/motion';
import { AIpicker,ColorPicker,FilePicker,Tab,CustomButton } from '../components';
const Customizer = () => {
  const snap=useSnapshot(state);

  const [file,setFile] = useState('');

  const [prompt,setPrompt] = useState('');
  const [generatingImg,setGeneratingImg] = useState(false);

  const [activeEditorTab, setActiveEditorTab] = useState("");
  const [activeFilterTab, setActiveFilterTab] = useState({
    logoShirt:true,
    stylishShirt:false,
  })

  const generateTabContent = () =>{
    switch(activeEditorTab){
      case "colorpicker":
        return <ColorPicker />
      case "filepicker":
        return <FilePicker 
        file ={file}
        setFile={setFile} 
        readFile={readFile}
        />
      case "aipicker":
        return <AIpicker
        prompt={prompt}
        setPrompt={setPrompt}
        generatingImg={generatingImg}
        handleSubmit={handleSubmit}
        />
      default:
        return null;
    }
  }

  const handleSubmit = async(type) =>{
    if(!prompt) return alert("Please enter a prompt");

    try{
      setGeneratingImg(true);
      // const response = await fetch('http://localhost:8080/api/v1/test',{
      //   method:'GET',
      //   headers:{
      //     'Content-Type':'application/json'
      //   },
      //   // body: JSON.stringify({
      //   //   prompt,
      //   // })


      // })
      // const d = await response.json();
      // console.log(d);
      setTimeout(() => {
        console.log('Waited for 10 seconds');
        // Perform additional actions here
      }, 10000);
      // if(d != null){
      // handleDecals(type,`data:image/png;base64,${d.data_image}`)
      // }
      var x = 6; // can be any number
      var rand = Math.floor(Math.random()*x) + 1
      switch(rand){
        case 1:
          const imageData1 = ""
          handleDecals(type,`data:image/png;base64,${imageData1}`)
          break;
        case 2:
          const imageData2 = ""
          handleDecals(type,`data:image/png;base64,${imageData2}`)
          break;
        case 3:
          const imageData3 = ""
          handleDecals(type,`data:image/png;base64,${imageData3}`)
          break;
        case 4:
          const imageData4 = ""
          handleDecals(type,`data:image/png;base64,${imageData4}`)
          break;
        case 5:
            const imageData5 = "iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mNk+A8AAQUBAScY42YAAAAASUVORK5CYII="
            handleDecals(type,`data:image/png;base64,${imageData5}`)
            break;
        case 6:
              const imageData6 = ""
              handleDecals(type,`data:image/png;base64,${imageData6}`)
              break;
        default:
          const imageData = ""
          handleDecals(type,`data:image/png;base64,${imageData}`)
          break;
      }
      // const imageData = ""
      // handleDecals(type,`data:image/png;base64,${imageData}`)
    }catch(error){
      const imageData = ""
      handleDecals(type,`data:image/png;base64,${imageData}`)
      // alert(error)
    }finally{
      setGeneratingImg(false);
      setActiveEditorTab("");
    }
  }

  const handleDecals=(type,result) =>{
    const decalType = DecalTypes[type];
    state[decalType.stateProperty] =result;
    if(!activeFilterTab[decalType.filterTab]){
      handleActiveFilterTab(decalType.filterTab)
    }
  }

  const handleActiveFilterTab = (tabName) =>{
    switch(tabName){
      case "logoShirt":
        state.isLogoTexture =!activeFilterTab[tabName];
        break;
      case "stylishShirt":
        state.isFullTexture =!activeFilterTab[tabName];
        break;
      default:
        state.isFullTexture=false;
        state.isLogoTexture=true;
        break;
    }

    setActiveFilterTab((prevState) =>{
      return {
        ...prevState,
        [tabName]:!prevState[tabName]
      }
    })
  }
  const readFile =(type) =>{
    reader(file)
    .then((result)=>{
      handleDecals(type,result);
      setActiveEditorTab("");
    })
  }
  return (
    <AnimatePresence>
        {
          !snap.intro && (
            <>
              <motion.div key="custom" className='absolute top-0 left-0 z-10' {...slideAnimation('left')}>
                <div className='flex items-center min-h-screen'>
                  <div className='editortabs-container tabs'>
                    {EditorTabs.map((tab)=>(
                      <Tab key={tab.name} tab={tab} handleClick={()=> setActiveEditorTab(tab.name)} />
                    )             
                    )}
                    {generateTabContent()}
                  </div>

                </div>
              </motion.div>
              <motion.div className='absolute z-10 top-5 right-5 {...fadeAnimation'>
                <CustomButton type="filled" title="Go Back" handleClick={()=>state.intro=true} 
                customStyles="w-fit px-4 py-2.5 font-bold text-sm" />

              </motion.div>
              <motion.div className='filtertabs-container' {...slideAnimation('up')}>
              {FilterTabs.map((tab)=>(
                      <Tab key={tab.name} tab={tab} 
                      isFilterTab 
                      isActiveTab={activeFilterTab[tab.name]}
                      handleClick={()=>handleActiveFilterTab(tab.name)} />
                    )             
                    )}
              </motion.div>
            </>
          )
        }
    </AnimatePresence>
  )
}

export default Customizer